import React, { useContext } from 'react';
import NavBar from "../../components/NavBar";
import { MyContext } from '../../context';
import { useToast, Grid, Box, Flex, Text } from '@chakra-ui/core';

const Dashboard = ({history}) => {
    const context = useContext(MyContext)
    const toast = useToast()

    return (
        <MyContext.Consumer>
            {context => {
                const {isLogged, user} = context.state
                return(
                    <>
                        <NavBar />
                        <Flex align="center">
                            <Flex bg="green.50" align="flex-end" h="100vh" w="20vw">
                                <Text>Box 1</Text>
                            </Flex>
                            <Flex bg="blue.50" size="150px" align="center" justify="center">
                                <Text textAlign="center" bg="pink.50">
                                Box 2
                                </Text>
                            </Flex>
                            <Flex bg="blue.50" size="150px" align="center" justify="center">
                                <Text textAlign="center" bg="pink.50">
                                Box 2
                                </Text>
                            </Flex>
                        </Flex>
                    </>
                )
            }}
        </MyContext.Consumer>
    );
};

export default Dashboard;
